%[text] # Slicer Volume Visualization - CTACardio Segmentations
%[text] In this module, we will load the CTACardio volume and segmentations that we created in Slicer.  Remember, segmentation files are label maps that have the same dimensions as the original volume, but have labels (numbers) instead of intensity values. There is a label value for each structure segmented from the original file. So, if there four structures segmented, there will be 4 labels in the volume (labels 1-4).
%[text] **File Extension Conventions:** In Slicer, intensity files are saved as **\*.nrrd files**, while segmentation files are saved as **\*.seg.nrrd files**
%[text] **IMPORTANT**
%[text] - Create a new folder in your MATLAB drive called MedImaging
%[text] - Copy this File to the MedImaging folder  \
%%
clearvars
close all
setupMatGeom %[output:40722a02]
%%
%[text] ## Set Folder path
%[text] - Review the name of your Crop Volume: Is it "CTACardio Crop.nrrd"?
%[text] - If you are using your folder, **update the** **`segment`** **path** to contain your last name
%[text] - Select your CTACardio folder. If you don't have one yet, you can choose the CTACardio folder in the unit3 folder. \
paths.project = "/Users/ernesto/MATLAB-Drive/MtMdata/unit3/CTACardio"; %[control:filebrowser:3f76]{"position":[17,70]}
ls(paths.project) % display folder contents %[output:92fbc479]
paths.intensity = fullfile(paths.project,"CTACardio Crop.nrrd");
paths.segment = fullfile(paths.project,"Salcedo Segmentation.seg.nrrd") %[output:8a75477a]
%[text] path check
structfun(@(x) exist(x,"file"),paths) % make sure paths exist - a zero mean the indicated file does not exist %[output:91a295ef]
%%
%[text] ## Load Volumes
%[text] ### Load the intensity volume
mVint = medicalVolume(paths.intensity) %[output:4d3d0bf8]
%[text] - notice that Voxels here is a structure (not a volume) \
%%
%[text] ### review Voxel Structure
%[text] This is unique to Slicer volumes (I believe)
mVint.Voxels %[output:344685ce]
%[text] - the Intensity values are stored in mVint.Voxels.pixelData \
%%
%[text] ### Load the segmentation volume
mVseg = medicalVolume(paths.segment) %[output:4600f3f4]
%[text] - same deal with the Segmentation Data \
%%
%[text] #### review the segmentation volume
mVseg.Voxels
%%
%[text] ### Visualize a Intensity Segmentation Overlay
%[text] We can overlay the segmentation of the intensity values using `volshow` as follows:
hvr3 = viewer3d(BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
%[text] - The function **`viewer3d`** is like `figure`, but for `volshow`.
%[text] - Nothing plots yet, but we set the properties of  the figure, like background \
%%
volshow(mVint.Voxels.pixelData,Parent=hvr3, ... %[output:group:93976fb9] %[output:08aa864c]
    RenderingStyle="GradientOpacity", ... % makes intensity volume transparent %[output:08aa864c]
    OverlayData=mVseg.Voxels.pixelData) % add Segmentations %[output:group:93976fb9] %[output:08aa864c]
%[text] - volshow actually displays the volumes \
%[text] Does it match Slicer?
%[text] ![](text:image:57a5)
%[text] - no - its inverted \
%%
%[text] ### Volume transformation
%[text] - If you compare to the volume display in slicer, the volumes here are inverted across the y axis (left = right and vice versa)
%[text] - This means that the volume is not being displayed properly
%[text] - Since we plugged in the Voxel data directly (mVint.Voxels.pixelData and mVseg.Voxels.pixelData), **`volshow`** didn't know how to properly transform the data
%[text] - Luckily, the medical volume inlcudes all the information necessary to properly transform the volume. Its found in the **`VolumeGeometry`** **field** 
%[text] - The function **`instrinsicToWorldMapping`** converts that field into a transformation matrix.  \
tform = intrinsicToWorldMapping(mVseg.VolumeGeometry) % create transformation matrix (scale, rotate, translate) %[output:054de329]
%%
hvr3 = viewer3d(BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
hvol = volshow(mVint.Voxels.pixelData,Parent=hvr3, ... %[output:group:2655d484] %[output:24ef5c5c]
    RenderingStyle="GradientOpacity", ... %[output:24ef5c5c]
    OverlayData=mVseg.Voxels.pixelData, ... %[output:24ef5c5c]
    Transformation=tform); % include transformation %[output:group:2655d484] %[output:24ef5c5c]
%[text] - right-click on image to add a scale bar
%[text] - right-click on image to save a screenshot to file \
%%
%[text] ### Use Slicer colors
%[text] The .SEG.NRRD file includes the segmentation information that you saved in Slicer. The following function loads that data
segT = mmGetSlicerSegTable(paths.segment) %[output:8e47e8ca]
%%
%[text] ### Plot Segmentations as Surfaces
%[text] volshow renders the volumes. But if we want to create a surface, we need to use `isosurface`. The course function **`mmPlotMask2Surface`** creates a surface from a mask using isosurface
%[text] ### Plot Aorta
figure %[output:4d4f8e86]
lval = 1; % set label that you want to plot
MASK = mVseg.Voxels.pixelData == lval; % Create mask
hp = mmPlotMask2Surface(MASK,... %[output:group:6f74bc1a] %[output:4d4f8e86]
    fcolor=segT.Color(lval,:),... %[output:4d4f8e86]
    affTrfm=tform.A); % apply transformation %[output:group:6f74bc1a] %[output:4d4f8e86]
%%
%[text] The function returns the handle to the surface
hp %[output:140b7239]
%%
%[text] ### Plot all Segmentations
figure; %[output:4fa80eb3]
hp = mmPlotAllSeg(mVseg,segT) %[output:4fa80eb3] %[output:3003c376]
%%
%[text] ## Region Properties
%[text] We can easily capture the region properties of our segments. First, we convert to a categorical, to clearly label our properties. Notice how we can use the data from the segT table to properly convert the volume to a categorical volume.
segCat = categorical(mVseg.Voxels.pixelData,segT.LabelValue,segT.SegName);
rp = regionprops3(segCat,'Volume') %[output:7edbf828]
%%
%[text] Convert to mm
rp.VolumeMM = rp.Volume * prod(mVseg.VoxelSpacing) %[output:3a589748]

